import { RadioGroup, FormControlLabel, Radio, FormControl, FormLabel } from '@mui/material';
import { UseFormSetValue } from 'react-hook-form';

interface WheelsStepProps {
  setValue: UseFormSetValue<any>;
}

export default function WheelsStep({ setValue }: WheelsStepProps) {
  return (
    <FormControl component="fieldset" sx={{ mt: 3 }}>
      <FormLabel component="legend">Number of Wheels</FormLabel>
      <RadioGroup 
        row
        onChange={(e) => setValue('wheels', parseInt(e.target.value))}
      >
        <FormControlLabel value="2" control={<Radio />} label="2 Wheels" />
        <FormControlLabel value="4" control={<Radio />} label="4 Wheels" />
      </RadioGroup>
    </FormControl>
  );
}
